import React, {Component} from "react";
import Server, {ServerInterface} from "./Server";

interface StateInterface {
    data: ServerInterface[];
}

class ServerList extends Component<{}, StateInterface> {
    state: StateInterface = {
        data: []
    };

    async componentDidMount() {
        const token = await localStorage.getItem('jwtToken');
        const response = await fetch('http://playground.tesonet.lt/v1/servers', {
            method: 'GET',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
                'Authorization': 'Bearer ' + token,
            }
        });

        const data = await response.json();

        this.setState({
            data
        });
    }

    createList() {
        const servers = this.state.data;

        const serversList = servers.map((server, i) => <Server key={i} name={server.name} distance={server.distance}/>);

        console.log(serversList);

        return serversList;
    }

    render() {
        return (
            <div>
                <table className="table">
                    <thead>
                    <tr>
                        <th scope="col">Server</th>
                        <th scope="col">Distance</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                    </tr>
                    <tr>
                        <th scope="row">2</th>
                        <td>Jacob</td>
                        <td>Thornton</td>
                        <td>@fat</td>
                    </tr>
                    <tr>
                        <th scope="row">3</th>
                        <td>Larry</td>
                        <td>the Bird</td>
                        <td>@twitter</td>
                    </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default ServerList;
